import React, { Fragment } from 'react';
import spinner from '../../img/spinner.gif';

export default () => (
  <Fragment>
    src={spinner}
    style={{ width: '200px', margin: 'auto', display: 'block' }}
    alt='loading'
  </Fragment>
);
